import React from "react";
import "./AdminPanel.css";
import bg__img from "../img/admin/admin_bg.jpg";
export default function AdminPanel() {
  return (
    <div className="body container">
      <div className="card">
        <div className="card-body">
          <h5 className="card-title">----- admin pane -----</h5>
          <h5></h5>
          <div className="row">
            <div className="col-md-6">
              <h6 className="card-subtitle mb-3 ">Enter UserName</h6>
              <input type="text" className="input__field" />
              <h6 className="card-subtitle mb-3 ">Enter Password</h6>
              <input type="text" className="input__field" />
            </div>
          </div>
        </div>
        <input type="submit" className="input__submit btn btn-success" />
      </div>
    </div>
  );
}
